  font-weight: bold;
  font-style: normal;
}
@font-face {
  font-family: "Geist";
  src: url("./fonts/Geist/Geist-Light.woff2") format("woff2");
  font-weight: lighter;
  font-style: normal;
}
.big-name {
  height: 40vh;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
}
.big-name-name {
  font-size: 3.5rem; 
  margin: 0; 
  color: white;
}
strong {
  color: white;
}

.blinking {
  color: #FF204E;
  animation: blink-animation 1s steps(2, start) infinite;
  -webkit-animation: blink-animation 1s steps(2, start) infinite;
}
@keyframes blink-animation {
  to {
    visibility: hidden;
  }
}
@-webkit-keyframes blink-animation {
  to {
    visibility: hidden;
  }
}

h3 {
  color: white;
}

.flex-row {
  display: flex;
  /* align-items: center; */
  justify-content: center;
  border-top: 1px #222 dashed;
  border-bottom: 1px #222 dashed;
  flex-direction: column;
}

.box {
  /* width: 30vw; */
  padding: 10px;
  text-align: left;
}
.left-box {
  /* border-right: 1px #222 dashed; */
  border-bottom: 1px #222 dashed;
}

.box h2 {
  margin-top: 0;
  margin-bottom: 0;
  color: white;
  font-size: 1.5rem;
}

.box p {
  margin-top: 0;
}

.box h2 {
  margin-top: 0;
  margin-bottom: 0;
  color: white;
  font-size: 1.5rem;
}

.box p {
  margin-top: 0;
}


a {
  color: #AF47D2;
  text-decoration: none;
  transition-property: color;
  transition-duration: 0.2s;
  transition-timing-function: ease-in;
}

a:hover {
  color: #FF70AB;
}

ul {
  text-align: left;
}

body {
  font-family: Geist, Gordita, Roboto, Oxygen, Ubuntu, Cantarell, "Open Sans",
    "Helvetica Neue", sans-serif;
  background-color: #000000;
  color: #DDD;
  font-size: 1rem;
  margin: 0;
  padding: 0;
}

.circle {
  border-radius: 50%;
}

.profile-pic {
  width: 200px;
  height: 200px;
  object-fit: cover;
}

main {
  text-align: center;
  /* padding: 1em; */
  margin-left: auto;
  margin-right: auto;
  margin-top: 50px;
  margin-bottom: 0;
}

h1 {
  color: #ffffff;
  font-size: 3rem;
  /* font-weight: 100; */
  font-weight: normal;
  line-height: 1.1;
  /* margin: 4rem auto; */
  margin: auto;
  /* max-width: 14rem; */
}

p {
  margin: 1em auto;
  line-height: 1.35;
}

@media (min-width: 480px) {
  .big-name-name {
    font-size: 4.5rem;
  }
  h1 {
    font-size: 4rem;
  }

  .box h2 {
    font-size: 2rem;
  }

  p {
    max-width: none;
  }

  body {
    font-size: 1.3rem;
  }

  .box {
    padding: 20px;
  }
}

@media (min-width: 1080px) {
  .profile-pic {
    width: 400px;
    height: 400px;
  }
  .big-name-name {
    font-size: 7rem;
  }
  .flex-row {
    flex-direction: row;
  }
  .box {
    width: 30vw;
    padding: 30px;
  }
  .left-box {
    border-right: 1px #222 dashed;
    border-bottom: none;
  }
  .box h2 {
    font-size: 2.5rem;
  }
  .box.solo {
    margin: auto;
    width: 50vw;
    border: 1px #222 dashed;
  }

}

